import React from 'react'
import { Route } from 'react-router'
import { Link } from 'react-router-dom'
import Contato from './Components/Contato'
import './Css/App.css'

const App = () => {
    return (
        <>
            <Route path='/contato' element={Contato} />
        </>
    )
}

export default App
